{"id": "1159788", "question": "Chào, hôm nay tôi đã đến thế giới di động, và vào quầy kiểm tra kỹ thuật miễn phí, rất hài lòng với cách phục vụ của các bạn. Nhưng có một chuyện làm tôi cảm thấy rất khó chịu như này:1) Tôi đến tgdđ để hỏi về việc điện thoại iPhone 7+ bị lỗi không nghe hay nói chuyện được khi đàm thoại, và bị mất icon loa ngoài2) Và sau đó, nhân viên bên bạn có nói tôi rằng sẽ tiến hành reset máy để kiểm tra có bình thường hay không3) Tôi vẫn đồng ý, nhưng lúc đó tôi có nói rằng:\"Có gì bạn check giúp mình trước rằng điện thoại này là lock hay quốc tế được không, vì lúc mình mua, có check là quốc tế, nhưng giờ bị lỗi như này thì sợ rằng nếu reset, ra lock thì nó lại tốn thời gian và tiền bạc.4) Bạn nói rằng không sao, không cần check. Lúc đó thì mình cũng ok, nghĩ rằng ko sao, vì máy thì sử dụng bình thường, nên không nghĩ rằng nó sẽ là máy lock.5) Nhưng đùng 1 cái, khi bạn reset lại, thì nó ra lock thật. Và mình vừa mất thời gian, vừa mất tiền để đi sửa máy. Mà còn không được gì. Thật sự rất bức xúc, nếu bạn kiểm tra máy kỹ giúp tôi, thì thật sự nó đã không làm tôi bực mình như thế này.Tất nhiên có thể câu chuyện cũng không hẳn là lỗi của nhân viên bên bạn, nhưng lời khuyên của tôi, sau này hãy check kỹ máy cho khách, trước khi tiến hành sửa chữa hay làm điều gì đó. Và hãy là người dùng thông minh, check kỹ càng trước khi mua máy, để tránh tình trạng bị dính cú lừa như mình các bạn nhé.Hiện trạng bây giờ của mình sau khi gắn sim ghép, thì điện thoại vẫn không nhận sim. Nói chung thà rằng mình ko sửa, thì không sao. Đi sửa rồi mang bệnh về nhà. Mất tiền bạc lẫn thời gian.."}
