{"id": "744812", "question": "Xin chào các bạn hôm này mình sẽ làm 1 bài so sánh chip do 2 nhà sản xuất Samsung và TSMC, bộ vi xử lý A9 của Apple được trang bị trong iPhone thế hệ mới có hai kích thước khác nhau. Trong đó, Samsung A9 mang mã số APL0898 đạt 96 mm, nhỏ hơn 10% so với AAPL1022 của TSMC với cỡ 104,5 mm. Người sử dụng sẽ không phân biệt được thiết bị nào dùng chip gì khi mua, trừ khi tháo rời sản phẩm hoặc tải ứng dụng   để kiểm tra theo mãVấn đề được quan tâm là có chênh lệch gì khi cùng mẫu iPhone 6s nhưng dùng chip của hai nhà sản xuất khác nhau, với công nghệ khác nhau.Theo đó, smartphone của Apple dùng chip từ có thời lượng pin tốt hơn từ 5% đến 12% so với iPhone 6s dùng chip , song nó lại cho hiệu suất thấp hơn khi thử nghiệm xuất file với . Thiết bị dùng chip của  hoàn thành nhiệm vụ nhanh hơn khoảng 4 giây.Tuy nhiên, khi đo đạc bằng các phần mềm chấm điểm hiệu năng như  thì iPhone 6s dùng chip TSMC lại cho kết quả tốt hơn. Điều này có nghĩa là người dùng sẽ không nhận thấy khác biệt quá lớn về tốc độ trong điều kiện sử dụng thực tế. Với các tác vụ thông thường, mức chênh lệch được nhận xét là khoảng 1%.Về phía Apple, hãng tuyên bố rằng mức chênh lệch về pin giữa iPhone 6s và 6s Plus dùng hai loại chip khác nhau chỉ từ 2 đến 3%. Công ty công nghệ Mỹ nói rằng sai khác trên là chấp nhận được, kể cả với các chip của cùng một nhà sản xuất.Dù vậy, bài kiểm tra pin với phần mềm  cho thấy, iPhone 6s dùng TSMC A9 có thời lượng pin cao hơn khoảng 1 giờ so với mẫu dùng chip do Samsung sản xuất. Ngoài ra, nó cũng cho điểm hiệu năng nhỉnh hơn.Sau khi qua các bài kiểm tra, dung lượng pin thực tế trên chiếc dùng Samsung A9 còn lại là 71%, còn với iPhone 6s dùng chip của TSMC đạt 77%. Như vậy, mức chênh lệch là 6%, cao gấp đôi tuyên bố 3% mà Apple đưa ra.Phía trên mình đưa ra những sự khác nhau giữa 2 chip giữa 2 công ty, theo đó cách đây vài tuần mình đã hỏi  tại  thì được 1 câu trả lời đó là 2 chip TSMC và Samsung  và không có sự khác biết nhiều.: Đề nghị  trước khi mua máy sẽ  bởi tất cả các hệ thống bán lẻ, và phân phối của Apple, đây là sự ngẫu nhiên theo các đợt hàng.​"}
