{"id": "786107", "question": "Ý tưởng iPhone 8 đầy bất ngờ với hai màn hình  Trong bản thiết kế này, iPhone 8 có một màn hình độ phân giải QHD và một màn hình độ phân giải 480p.   Nhà thiết kế có tiếng Jermaine Smit mới đây đã trở lại cùng bản concept mới của mình mô phỏng thiết bị  đến từ  cùng nhiều điểm nhấn mới lạ. Ngay trong đoạn giới thiệu ban đầu, tác giả đã chia sẻ iPhone 8 trong concept được lấy cảm hứng từ thiết kế của 4 và iPhone 5, hai trong số những phiên bản iPhone được nhiều người dùng yêu thích nhất. Bản thiết kế iPhone 8 với hai màn hình của Jermaine Smit. Có thể thấy chiếc iPhone này không còn nút Home truyền thống. Ở vị trí của nút Home xuất hiện logo Apple cùng dòng chữ iPhone.Điểm thay đổi thú vị nhất có trên iPhone 8 của Jermaine Smit nằm ở việc nó sở hữu hai màn hình, trong đó có một màn hình mang độ phân giải 2K để mang lại các trải nghiệm về hình ảnh tốt nhất và màn hình còn lại có độ phân giải dừng lại ở 480p cho mục đích tiết kiệm thời lượng pin. Mặc dù không đi sâu vào chia sẻ suy nghĩ của mình về thông số kỹ thuật có trên chiếc iPhone 8, bản thiết kế của Jermaine Smit vẫn được đánh giá cao ở phần nhìn chân thực cùng các tính năng thêm vào khá thực tế với công nghệ hiện tại. Chiếc smartphone trong bản thiết kế này chỉ có duy nhất một camera. Bên cạnh trái máy có nút tăng giảm âm lượng, nút gạt tắt - mở âm thanh và phần phát laser đóng vai trò là một bàn phím ảo. Cạnh phải được bố trí nút nguồn và khe SIM. Mô phỏng tính năng bàn phím laser."}
