{"id": "786102", "question": "Mẫu concept này cho thấy Iphone 7 có độ mỏng tuyệt vời, mỏng hơn rất nhiều so với Iphone 6,Đây là câu hỏi có khá nhiều người quan tâm. Hãng Apple có một thường ra mắt thế hệ iPhone mới vào tháng 9 - đây được coi như một thông lệ từ những phiên bản trước. Như vậy, nếu như Apple tiếp tục truyền thống của mình, chúng ta có thể trông đợi iPhone 7 được ra mắt vào tháng 9/2015.Đây là hình ảnh chiếc iPhone mà cộng đồng công nghệ đang truyền tay nhau. Với những đường nét khá giống với iPhone 6, iPhone hứa hẹn sẽ mang lại nhiều tính năng cũng như tiện ích vượt trội hơn so với người tiền nhiệm của mình.Cộng đồng mạng cũng bổ xung thêm những đồn đoán về mẫu Iphone 7 nàyKhông chỉ là đồ họa cho sản phẩm sắp lên kệ của Apple, nhà thiết kế Jermaine Smit còn mang đến cả một mô hình iPhone 7 khá ấn tượng với những đường nét tinh xảo. Chiếc iphone 7 concept này được thiết kế với không viền màn hình và tối ưu với màn hình rộng và bo xung quành bằng hợp kim nhôm. Cùng với các tính năng khác như công nghệ sạc pin nhanh, nút Home được tích hợp máy quét vân tay.Các thông tin chi tiết về phần cứng chưa được tiết lộ nhiều. Dự kiến iPhone 7 sẽ có một phiên bản màn hình 4.7 inch và một phiên bản màn hình to hơn. Sản phẩm được trang bị RAM 2GB, máy ảnh trước 4MP hỗ trợ nhiều tính năng trên nền tảng cùng iOS 9.Giá iPhone 7 bao nhiêu cũng là từ khóa hiện đang được tìm khá nhiều. Theo như một số thông tin chúng tôi tổng hợp được thì iPhone 7 được giới phân tích dự đoán là mẫu iPhone được cái tiến về phần cứng mạnh mẽ gấp 2,5 lần iPhone 6 với chip xử lí A9 siêu mạnh trên nền tản 64 bit. Việc này cũng có thể ảnh hưởng đén giá bán của iPhone 7. Như tờ Inquirer đã đưa tin thì giá của chiếc iPhone 7 vẫn chưa được công bố, nhưng có thể nó có giá tương đương với chiếc iPhone 6 hồi năm ngoái.Nếu Apple công bố iPhone 7 Plus với màn hình lớn hơn, giá của thiết bị công nghệ này dự đoán rơi vào khoảng 619 bảng Anh, 699 bảng Anh hoặc 789 bảng Anh, tương ứng với các phiên bản 16 GB, 64 GB và 128 GB.Là một trong đối tác lắp ráp sản phẩm lớn của Apple, Foxconn đang có kế hoạch đầu tư một nhà máy sapphire tại Đài Loan với giá trị ước tính vào khoảng 2,6 tỷ USD. Chính thông tin này khiến người ta đồn thổi các thông tin về iPhone 7 sẽ được trang bị màn hình kính sapphire.Daily Mail cho rằng ngày phát hành iPhone mới có thể còn phụ thuộc vào Apple Watch, sản phẩm sẽ xuất hiện trên thị trường vào đầu năm sau. Đây là sản phẩm then chốt của hãng và hứa hẹn mở ra kỷ nguyên mới về thiết bị đeo.Với một số hình ảnh và thông tin mới nhất về iPhone 7 mà chúng tôi đã tổng hợp trên đây, hi vọng sẽ thỏa mãn được phần nào những thông tin mà bạn đọc đang tìm kiếm. Cùng chiêm ngưỡng thêm "}
